import React, { Component } from 'react';
import './App.css';
import { Layout, Header, Navigation, Drawer, Content } from "react-mdl";

class App extends Component {
  render() {
    return (

        <div className="demo-big-content">
          <Layout>
            <Header title="Title" scroll>
              <Navigation>
                <a href="/">Link1</a>
                <a href="/">Link2</a>
                <a href="/">Link3</a>
                <a href="/">Link4</a>
              </Navigation>
            </Header>
            <Drawer title="Title">
              <Navigation>
                <a href="/">Link.1</a>
                <a href="/">Link.2</a>
                <a href="/">Link.3</a>
                <a href="/">Link.4</a>
              </Navigation>
            </Drawer>
            <Content>
              <div className="page-content" />
            </Content>
          </Layout>
        </div>

    );
  }
}

export default App;
